"use strict";(self.webpackChunkblog_tools=self.webpackChunkblog_tools||[]).push([[4952],{9621:(n,t,s)=>{s.r(t),s.d(t,{data:()=>a});const a={key:"v-0a9c44fd",path:"/Redis/8-Redis-commands.html",title:"8-Redis 数据库相关指令",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"一、数据库操作指令",slug:"一、数据库操作指令",children:[]},{level:2,title:"二、操作key相关指令",slug:"二、操作key相关指令",children:[]},{level:2,title:"三、String类型",slug:"三、string类型",children:[]},{level:2,title:"四、List 类型",slug:"四、list-类型",children:[]},{level:2,title:"五、Set 类型",slug:"五、set-类型",children:[]},{level:2,title:"六、ZSet 类型",slug:"六、zset-类型",children:[]},{level:2,title:"七、hash类型",slug:"七、hash类型",children:[]}],filePathRelative:"Redis/8-Redis-commands.md",git:{updatedTime:163819854e4,contributors:[{name:"suanfa8",email:"45396320+suanfa8@users.noreply.github.com",commits:3}]}}},923:(n,t,s)=>{s.r(t),s.d(t,{default:()=>l});const a=(0,s(6252).uE)('<h1 id="_8-redis-数据库相关指令" tabindex="-1"><a class="header-anchor" href="#_8-redis-数据库相关指令" aria-hidden="true">#</a> 8-Redis 数据库相关指令</h1><h2 id="一、数据库操作指令" tabindex="-1"><a class="header-anchor" href="#一、数据库操作指令" aria-hidden="true">#</a> 一、数据库操作指令</h2><ol><li>Redis 中库说明</li></ol><ul><li>使用 Redis 的默认配置器动 redis 服务后，默认会存在 16 个库，编号从 0-15</li><li>可以使用 select 库的编号 来选择一个 redis 的库</li></ul><ol start="2"><li>Redis中操作库的指令</li></ol><ul><li>清空当前的库 FLUSHDB</li><li>清空全部的库 FLUSHALL</li></ul><ol start="3"><li>Redis 客户端显示中文</li></ol><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>./redis-cli  -p 7000 --raw\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="二、操作key相关指令" tabindex="-1"><a class="header-anchor" href="#二、操作key相关指令" aria-hidden="true">#</a> 二、操作key相关指令</h2><div class="language-markdown ext-md line-numbers-mode"><pre class="language-markdown"><code><span class="token title important"><span class="token punctuation">#</span> 1.DEL指令</span>\n<span class="token list punctuation">-</span> 语法 :  DEL key [key ...] \n<span class="token list punctuation">-</span> 作用 :  删除给定的一个或多个key 。不存在的key 会被忽略。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值： 被删除key 的数量。 \n\n<span class="token title important"><span class="token punctuation">#</span> 2.EXISTS指令</span>\n<span class="token list punctuation">-</span> 语法:  EXISTS key\n<span class="token list punctuation">-</span> 作用:  检查给定key 是否存在。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值： 若key 存在，返回1 ，否则返回0。\n\n<span class="token title important"><span class="token punctuation">#</span> 3.EXPIRE</span>\n<span class="token list punctuation">-</span> 语法:  EXPIRE key seconds\n<span class="token list punctuation">-</span> 作用:  为给定key 设置生存时间，当key 过期时(生存时间为0 )，它会被自动删除。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 时间复杂度： O(1)\n<span class="token list punctuation">-</span> 返回值：设置成功返回1 。\n\n<span class="token title important"><span class="token punctuation">#</span> 4.KEYS</span>\n<span class="token list punctuation">-</span> 语法 :  KEYS pattern\n<span class="token list punctuation">-</span> 作用 :  查找所有符合给定模式pattern 的key 。\n<span class="token list punctuation">-</span> 语法:\n\tKEYS <span class="token italic"><span class="token punctuation">*</span><span class="token content"> 匹配数据库中所有key 。\n\tKEYS h?llo 匹配hello ，hallo 和hxllo 等。\n\tKEYS h</span><span class="token punctuation">*</span></span>llo 匹配hllo 和heeeeello 等。\n\tKEYS h[ae]llo 匹配hello 和hallo ，但不匹配hillo 。特殊符号用 &quot;\\&quot; 隔开\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值： 符合给定模式的key 列表。\n\n<span class="token title important"><span class="token punctuation">#</span> 5.MOVE</span>\n<span class="token list punctuation">-</span> 语法 :  MOVE key db\n<span class="token list punctuation">-</span> 作用 :  将当前数据库的key 移动到给定的数据库db 当中。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值： 移动成功返回1 ，失败则返回0 。\n\n<span class="token title important"><span class="token punctuation">#</span> 6.PEXPIRE</span>\n<span class="token list punctuation">-</span> 语法 :  PEXPIRE key milliseconds\n<span class="token list punctuation">-</span> 作用 :  这个命令和EXPIRE 命令的作用类似，但是它以毫秒为单位设置key 的生存时间，而不像EXPIRE 命令那样，以秒为单位。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 2.6.0\n<span class="token list punctuation">-</span> 时间复杂度： O(1)\n<span class="token list punctuation">-</span> 返回值：设置成功，返回1  key 不存在或设置失败，返回0\n\n<span class="token title important"><span class="token punctuation">#</span> 7.PEXPIREAT</span>\n<span class="token list punctuation">-</span> 语法 :  PEXPIREAT key milliseconds-timestamp\n<span class="token list punctuation">-</span> 作用 :  这个命令和EXPIREAT 命令类似，但它以毫秒为单位设置key 的过期unix 时间戳，而不是像EXPIREAT那样，以秒为单位。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 2.6.0\n<span class="token list punctuation">-</span> 返回值：如果生存时间设置成功，返回1 。当key 不存在或没办法设置生存时间时，返回0 。(查看EXPIRE 命令获取更多信息)\n\n<span class="token title important"><span class="token punctuation">#</span> 8.TTL</span>\n<span class="token list punctuation">-</span> 语法 :   TTL key\n<span class="token list punctuation">-</span> 作用 :   以秒为单位，返回给定key 的剩余生存时间(TTL, time to live)。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值：\n\t当key 不存在时，返回-2 。\n\t当key 存在但没有设置剩余生存时间时，返回-1 。\n\t否则，以秒为单位，返回key 的剩余生存时间。\n<span class="token list punctuation">-</span> Note : 在Redis 2.8 以前，当key 不存在，或者key 没有设置剩余生存时间时，命令都返回-1 。\n\n<span class="token title important"><span class="token punctuation">#</span> 9.PTTL</span>\n<span class="token list punctuation">-</span> 语法 :  PTTL key\n<span class="token list punctuation">-</span> 作用 :  这个命令类似于TTL 命令，但它以毫秒为单位返回key 的剩余生存时间，而不是像TTL 命令那样，以秒为单位。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 2.6.0\n<span class="token list punctuation">-</span> 返回值： 当key 不存在时，返回-2 。当key 存在但没有设置剩余生存时间时，返回-1 。\n<span class="token list punctuation">-</span> 否则，以毫秒为单位，返回key 的剩余生存时间。\n<span class="token list punctuation">-</span> 注意 : 在Redis 2.8 以前，当key 不存在，或者key 没有设置剩余生存时间时，命令都返回-1 。\n\n<span class="token title important"><span class="token punctuation">#</span> 10.RANDOMKEY</span>\n<span class="token list punctuation">-</span> 语法 :  RANDOMKEY\n<span class="token list punctuation">-</span> 作用 :  从当前数据库中随机返回(不删除) 一个key 。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值：当数据库不为空时，返回一个key 。当数据库为空时，返回nil 。\n\n<span class="token title important"><span class="token punctuation">#</span> 11.RENAME</span>\n<span class="token list punctuation">-</span> 语法 :  RENAME key newkey\n<span class="token list punctuation">-</span> 作用 :  将key 改名为newkey 。当key 和newkey 相同，或者key 不存在时，返回一个错误。当newkey 已经存在时，RENAME 命令将覆盖旧值。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值： 改名成功时提示OK ，失败时候返回一个错误。\n\n<span class="token title important"><span class="token punctuation">#</span> 12.TYPE</span>\n<span class="token list punctuation">-</span> 语法 :  TYPE key\n<span class="token list punctuation">-</span> 作用 :  返回key 所储存的值的类型。\n<span class="token list punctuation">-</span> 可用版本： &gt;= 1.0.0\n<span class="token list punctuation">-</span> 返回值：\n\tnone (key 不存在)\n\tstring (字符串)\n\tlist (列表)\n\tset (集合)\n\tzset (有序集)\n\thash (哈希表)\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br><span class="line-number">16</span><br><span class="line-number">17</span><br><span class="line-number">18</span><br><span class="line-number">19</span><br><span class="line-number">20</span><br><span class="line-number">21</span><br><span class="line-number">22</span><br><span class="line-number">23</span><br><span class="line-number">24</span><br><span class="line-number">25</span><br><span class="line-number">26</span><br><span class="line-number">27</span><br><span class="line-number">28</span><br><span class="line-number">29</span><br><span class="line-number">30</span><br><span class="line-number">31</span><br><span class="line-number">32</span><br><span class="line-number">33</span><br><span class="line-number">34</span><br><span class="line-number">35</span><br><span class="line-number">36</span><br><span class="line-number">37</span><br><span class="line-number">38</span><br><span class="line-number">39</span><br><span class="line-number">40</span><br><span class="line-number">41</span><br><span class="line-number">42</span><br><span class="line-number">43</span><br><span class="line-number">44</span><br><span class="line-number">45</span><br><span class="line-number">46</span><br><span class="line-number">47</span><br><span class="line-number">48</span><br><span class="line-number">49</span><br><span class="line-number">50</span><br><span class="line-number">51</span><br><span class="line-number">52</span><br><span class="line-number">53</span><br><span class="line-number">54</span><br><span class="line-number">55</span><br><span class="line-number">56</span><br><span class="line-number">57</span><br><span class="line-number">58</span><br><span class="line-number">59</span><br><span class="line-number">60</span><br><span class="line-number">61</span><br><span class="line-number">62</span><br><span class="line-number">63</span><br><span class="line-number">64</span><br><span class="line-number">65</span><br><span class="line-number">66</span><br><span class="line-number">67</span><br><span class="line-number">68</span><br><span class="line-number">69</span><br><span class="line-number">70</span><br><span class="line-number">71</span><br><span class="line-number">72</span><br><span class="line-number">73</span><br><span class="line-number">74</span><br><span class="line-number">75</span><br><span class="line-number">76</span><br><span class="line-number">77</span><br><span class="line-number">78</span><br><span class="line-number">79</span><br><span class="line-number">80</span><br><span class="line-number">81</span><br><span class="line-number">82</span><br><span class="line-number">83</span><br><span class="line-number">84</span><br><span class="line-number">85</span><br><span class="line-number">86</span><br><span class="line-number">87</span><br><span class="line-number">88</span><br><span class="line-number">89</span><br><span class="line-number">90</span><br></div></div><h2 id="三、string类型" tabindex="-1"><a class="header-anchor" href="#三、string类型" aria-hidden="true">#</a> 三、String类型</h2><h4 id="_1-内存存储模型" tabindex="-1"><a class="header-anchor" href="#_1-内存存储模型" aria-hidden="true">#</a> 1. 内存存储模型</h4><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gwtj4q6qp4j31lu0fe404.jpg" alt="image-20200623132104399"></p><h4 id="_2-常用操作命令" tabindex="-1"><a class="header-anchor" href="#_2-常用操作命令" aria-hidden="true">#</a> 2. 常用操作命令</h4><table><thead><tr><th>命令</th><th>说明</th></tr></thead><tbody><tr><td>set</td><td>设置一个key/value</td></tr><tr><td>get</td><td>根据key获得对应的value</td></tr><tr><td>mset</td><td>一次设置多个key value</td></tr><tr><td>mget</td><td>一次获得多个key的value</td></tr><tr><td>getset</td><td>获得原始key的值，同时设置新值</td></tr><tr><td>strlen</td><td>获得对应key存储value的长度</td></tr><tr><td>append</td><td>为对应key的value追加内容</td></tr><tr><td>getrange 索引0开始</td><td>截取value的内容</td></tr><tr><td>setex</td><td>设置一个key存活的有效期（秒）</td></tr><tr><td>psetex</td><td>设置一个key存活的有效期（毫秒）</td></tr><tr><td>setnx</td><td>存在不做任何操作,不存在添加</td></tr><tr><td>msetnx原子操作(只要有一个存在不做任何操作)</td><td>可以同时设置多个key,只有有一个存在都不保存</td></tr><tr><td>decr</td><td>进行数值类型的-1操作</td></tr><tr><td>decrby</td><td>根据提供的数据进行减法操作</td></tr><tr><td>Incr</td><td>进行数值类型的+1操作</td></tr><tr><td>incrby</td><td>根据提供的数据进行加法操作</td></tr><tr><td>Incrbyfloat</td><td>根据提供的数据加入浮点数</td></tr></tbody></table><h2 id="四、list-类型" tabindex="-1"><a class="header-anchor" href="#四、list-类型" aria-hidden="true">#</a> 四、List 类型</h2><p>list 列表 相当于java中list 集合 特点 元素有序 且 可以重复</p><h4 id="_1-内存存储模型-1" tabindex="-1"><a class="header-anchor" href="#_1-内存存储模型-1" aria-hidden="true">#</a> 1.内存存储模型</h4><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gwtj4uednej31mc0hugnh.jpg" alt="image-20200623161114380"></p><h4 id="_2-常用操作指令" tabindex="-1"><a class="header-anchor" href="#_2-常用操作指令" aria-hidden="true">#</a> 2.常用操作指令</h4><table><thead><tr><th>命令</th><th>说明</th></tr></thead><tbody><tr><td>lpush</td><td>将某个值加入到一个key列表头部</td></tr><tr><td>lpushx</td><td>同lpush,但是必须要保证这个key存在</td></tr><tr><td>rpush</td><td>将某个值加入到一个key列表末尾</td></tr><tr><td>rpushx</td><td>同rpush,但是必须要保证这个key存在</td></tr><tr><td>lpop</td><td>返回和移除列表左边的第一个元素</td></tr><tr><td>rpop</td><td>返回和移除列表右边的第一个元素</td></tr><tr><td>lrange</td><td>获取某一个下标区间内的元素</td></tr><tr><td>llen</td><td>获取列表元素个数</td></tr><tr><td>lset</td><td>设置某一个指定索引的值(索引必须存在)</td></tr><tr><td>lindex</td><td>获取某一个指定索引位置的元素</td></tr><tr><td>lrem</td><td>删除重复元素</td></tr><tr><td>ltrim</td><td>保留列表中特定区间内的元素</td></tr><tr><td>linsert</td><td>在某一个元素之前，之后插入新元素</td></tr></tbody></table><h2 id="五、set-类型" tabindex="-1"><a class="header-anchor" href="#五、set-类型" aria-hidden="true">#</a> 五、Set 类型</h2><p>特点: Set类型 Set集合 元素无序 不可以重复</p><h4 id="_1-内存存储模型-2" tabindex="-1"><a class="header-anchor" href="#_1-内存存储模型-2" aria-hidden="true">#</a> 1.内存存储模型</h4><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gwtj4y1vmgj31ss0qctax.jpg" alt="image-20200623193634316"></p><h4 id="_2-常用命令" tabindex="-1"><a class="header-anchor" href="#_2-常用命令" aria-hidden="true">#</a> 2.常用命令</h4><table><thead><tr><th>命令</th><th>说明</th></tr></thead><tbody><tr><td>sadd</td><td>为集合添加元素</td></tr><tr><td>smembers</td><td>显示集合中所有元素 无序</td></tr><tr><td>scard</td><td>返回集合中元素的个数</td></tr><tr><td>spop</td><td>随机返回一个元素 并将元素在集合中删除</td></tr><tr><td>smove</td><td>从一个集合中向另一个集合移动元素 必须是同一种类型</td></tr><tr><td>srem</td><td>从集合中删除一个元素</td></tr><tr><td>sismember</td><td>判断一个集合中是否含有这个元素</td></tr><tr><td>srandmember</td><td>随机返回元素</td></tr><tr><td>sdiff</td><td>去掉第一个集合中其它集合含有的相同元素</td></tr><tr><td>sinter</td><td>求交集</td></tr><tr><td>sunion</td><td>求和集</td></tr></tbody></table><h2 id="六、zset-类型" tabindex="-1"><a class="header-anchor" href="#六、zset-类型" aria-hidden="true">#</a> 六、ZSet 类型</h2><p>特点: 可排序的set集合 排序 不可重复</p><p>ZSET 官方 可排序SET sortSet</p><h4 id="_1-内存模型" tabindex="-1"><a class="header-anchor" href="#_1-内存模型" aria-hidden="true">#</a> 1.内存模型</h4><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gwtj52lph1j30ud0d3q3o.jpg" alt="image-20200623194903967"></p><h4 id="_2-常用命令-1" tabindex="-1"><a class="header-anchor" href="#_2-常用命令-1" aria-hidden="true">#</a> 2.常用命令</h4><table><thead><tr><th>命令</th><th>说明</th></tr></thead><tbody><tr><td>zadd</td><td>添加一个有序集合元素</td></tr><tr><td>zcard</td><td>返回集合的元素个数</td></tr><tr><td>zrange 升序 zrevrange 降序</td><td>返回一个范围内的元素</td></tr><tr><td>zrangebyscore</td><td>按照分数查找一个范围内的元素</td></tr><tr><td>zrank</td><td>返回排名</td></tr><tr><td>zrevrank</td><td>倒序排名</td></tr><tr><td>zscore</td><td>显示某一个元素的分数</td></tr><tr><td>zrem</td><td>移除某一个元素</td></tr><tr><td>zincrby</td><td>给某个特定元素加分</td></tr></tbody></table><h2 id="七、hash类型" tabindex="-1"><a class="header-anchor" href="#七、hash类型" aria-hidden="true">#</a> 七、hash类型</h2><p>特点: value 是一个map结构 存在key value key 无序的</p><h4 id="_1-内存模型-1" tabindex="-1"><a class="header-anchor" href="#_1-内存模型-1" aria-hidden="true">#</a> 1.内存模型</h4><p><img src="https://tva1.sinaimg.cn/large/008i3skNgy1gwtj57n15qj30tf0elgmi.jpg" alt="image-20200623200348408"></p><h4 id="_2-常用命令-2" tabindex="-1"><a class="header-anchor" href="#_2-常用命令-2" aria-hidden="true">#</a> 2.常用命令</h4><table><thead><tr><th>命令</th><th>说明</th></tr></thead><tbody><tr><td>hset</td><td>设置一个key/value对</td></tr><tr><td>hget</td><td>获得一个key对应的value</td></tr><tr><td>hgetall</td><td>获得所有的key/value对</td></tr><tr><td>hdel</td><td>删除某一个key/value对</td></tr><tr><td>hexists</td><td>判断一个key是否存在</td></tr><tr><td>hkeys</td><td>获得所有的key</td></tr><tr><td>hvals</td><td>获得所有的value</td></tr><tr><td>hmset</td><td>设置多个key/value</td></tr><tr><td>hmget</td><td>获得多个key的value</td></tr><tr><td>hsetnx</td><td>设置一个不存在的key的值</td></tr><tr><td>hincrby</td><td>为value进行加法运算</td></tr><tr><td>hincrbyfloat</td><td>为value加入浮点值</td></tr></tbody></table>',40),e={},l=(0,s(3744).Z)(e,[["render",function(n,t){return a}]])},3744:(n,t)=>{t.Z=(n,t)=>{const s=n.__vccOpts||n;for(const[n,a]of t)s[n]=a;return s}}}]);